import React from "react";
import styled from "styled-components";

const TableContainer = styled.table`
  width: 100%;
  table-layout: auto;
  border-radius: 0.125rem;
`;

const TableHead = styled.th`
  padding: 1rem;
  text-align: left;
  color: white;
  background-color: rgb(59 130 246);
  font-size: 0.875rem;
  line-height: 1.25rem;
  font-weight: 500;
`;

const TableData = styled.td`
  border-top: 1px solid rgb(209 213 219);
  border-bottom: 1px solid rgb(209 213 219);
  padding: 2rem 1rem;
  font-size: 0.875rem;
  line-height: 1.25rem;
  & > img {
    width: 4rem;
    height: 2rem;
    border-radius: 1rem;
    object-fit: contain;
    object-position: center;
  }
`;

const TableRow = styled.tr`
  /*  border-gray-300 even:bg-gray-300 */
`;

function Table2() {
  return (
    <TableContainer>
      <thead>
        <tr>
          <TableHead>Shop</TableHead>
          <TableHead>Product</TableHead>
          <TableHead>Date</TableHead>
          <TableHead>Rating</TableHead>
          <TableHead>Price</TableHead>
        </tr>
      </thead>
      <tbody>
        <TableRow>
          <TableData>
            <img src="data:image/png;base64," />
          </TableData>
          <TableData>Food</TableData>
          <TableData>March 1st</TableData>
          <TableData>7</TableData>
          <TableData>$50</TableData>
        </TableRow>
        <TableRow>
          <TableData>
            <img src="data:image/png;base64," />
          </TableData>
          <TableData>Food</TableData>
          <TableData>March 5th</TableData>
          <TableData>10</TableData>
          <TableData>$500</TableData>
        </TableRow>
        <TableRow>
          <TableData>
            <img src="data:image/png;base64," />
          </TableData>
          <TableData>McDonalds</TableData>
          <TableData>March 12th</TableData>
          <TableData>4</TableData>
          <TableData>$30</TableData>
        </TableRow>
        <TableRow>
          <TableData>
            <img src="data:image/png;base64," />
          </TableData>
          <TableData>China In Box</TableData>
          <TableData>March 31st</TableData>
          <TableData>10</TableData>
          <TableData>$40</TableData>
        </TableRow>
      </tbody>
    </TableContainer>
  );
}

export default Table2;
